import React from 'react';
import '../../css/header.css';
import classes from './header.module.css';
import {NavLink} from "react-router-dom";
const Header = () => {
    let navigation=
        [
            {id:'profile',name:'Profile', active:classes.active},
            {id:'dialog',name:'Dialog', active:classes.active},
            {id:'news',name:'News', active:classes.active},
            {id:'music',name:'Music', active:classes.active},
            {id:'setting',name:'Setting', active:classes.active},
        ]
    let navigationElement = navigation.map(nav=><li><NavLink to="/" activeClassName={classes.active}>Profile</NavLink> </li>)
    return (
        <header className={classes.header}>
            <div className={classes.contentHeader}>
                <div className={classes.logo}>
                    <img className={classes.icons} src='https://3.bp.blogspot.com/-gSCjFoMwSrM/Wmhhcg2_WsI/AAAAAAAAN0s/YF9kM5Jnt30hautbcSOIg70qUQhEGyqWgCLcBGAs/s1600/dallas_mavericks.png' ></img>
                </div>
                <div className={classes.menu}>
                    <ul>
                        <li><NavLink to="/profile" activeClassName={classes.active}>Profile</NavLink> </li>
                        <li><NavLink to="/dialog" activeClassName={classes.active}>Messages</NavLink> </li>
                        <li><NavLink to="">News</NavLink> </li>
                        <li><NavLink to="">Music</NavLink> </li>
                        <li><NavLink to="">Setting</NavLink> </li>
                    </ul>
                </div>
            </div>
        </header>
    );
}
export default Header;
